mongodb - summations of array length with same ids<p>I am creating a platform where people can share their memes. On one page I want to show them who are the most popular members on the platform. so, there is a collection of 'meme' and 'user'</p>

<p>for example,</p>

<p>There is two content with same ids:</p>

<pre><code>{
  _id: 1,
  username: "name",
  bio: "bio",
  image: "url",
};
</code></pre>

<p>memes</p>

<pre><code>{
  _id: 0,
  user_id: 1,
  image: "meme1.jpg",
  likes: [
    {
      user_id: 4
    }
  ]
},
{
  _id: 1,
  user_id: 1,
  image: "meme2.jpg",
  likes: [
    {
      user_id: 5
    },
    {
      user_id: 6
    }
  ]
}
</code></pre>

<p>and I want to output something like this way</p>

<pre><code>{
  user_id:1,
  username:"name"
  likes:3,
}
</code></pre>

<p>I wrote this query using aggregate functions but I am not understanding how to identify ids are the same or not?</p>

<pre class="lang-js prettyprint-override"><code>meme
  .aggregate([
    {
      $lookup: {
        from: "users",
        localField: "user_id",
        foreignField: "_id",
        as: "userDetails",
      },
    },
    {
      $project: {
        user_id: "$user_id",
        username: "$userDetails.username",
        likes: {
          $size: "$likes",
        },
      },
    },
    {
      $sort: { likes: 1 },
    },
  ])
  .exec()
  .then((result) =&gt; {
    console.log(result);
  });
</code></pre>

