How to resolve com.mongodb.spark.exceptions.MongoTypeConversionException: Cannot cast... Java Spark<p>Hi I am new to Java Spark, and have been looking for solutions for couple of days.</p>

<p>I am working on loading MongoDB data into hive table, however, I found some error while saveAsTable that occurs this error</p>

<pre><code>com.mongodb.spark.exceptions.MongoTypeConversionException: Cannot cast STRING into a StructType(StructField(oid,StringType,true)) (value: BsonString{value='54d3e8aeda556106feba7fa2'})
</code></pre>

<p>I've tried increase the sampleSize, different mongo-spark-connector versions, ... but non of working solutions.</p>

<p>I can't figure out what is the root cause and what are the gaps in between that needs to be done?</p>

<p>The most confusing part is I have similar sets of data using the same flow without issue.</p>

<p>the mongodb data schema is like nested struct and array</p>

