How to solve DELETE error 404 not found express.js<p>I am learning a MEAN Stack course. I can successfully add new data and fletch data but when I trying to DELETE data then the problem is occurring. error is saying <em>"DELETE <a href="http://localhost:3200/posts/5e831685bf7c02d96057db9e" rel="nofollow noreferrer">http://localhost:3200/posts/5e831685bf7c02d96057db9e</a> 404 (Not Found)"</em>. I'll provide below all the code file files please someone help me on this.</p>

<hr>

<p>Error screenshot </p>

<p><a href="https://i.stack.imgur.com/jPsuL.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/jPsuL.png" alt="enter image description here"></a></p>

<hr>

<p>I'm using on this project,
<em>Angular</em>, <em>node.js | express.js</em>, <em>mongoDB | mongoose</em>, <em>angular material</em></p>

