      {{post.title}}
    &lt;/mat-expansion-panel-header&gt;
    &lt;p&gt;{{post.content}}&lt;/p&gt;
    &lt;mat-action-row&gt;
      &lt;button mat-button color="primary" &gt;EDIT&lt;/button&gt;
      &lt;button mat-button color="warn" (click)="onDelete(post.id)" &gt;DELETE&lt;/button&gt;
    &lt;/mat-action-row&gt;
