MongoDB - How can I find all other related documents from all collections. I have access to only 1 id<h1>Hello I am using mongoose to search for similar posts in my collection.</h1>
<pre><code>/*Product model*/

    const productSchema = mongoose.Schema(
      {
        writer: {
          type: Schema.Types.ObjectId,
          ref: &quot;User&quot;,
        },
        title: {
          type: String,
          maxlength: 50,
        },
        description: {
          type: String,
        },
        Category: {
          type: String,
          default: &quot;Mobiles&quot;,
        }
    );
</code></pre>
<p>I can have access to only a single id at a time, what I want is to have access to all other posts</p>
<p>which have common
string in their title, description or category.</p>
<p>In params I have only Product _id.</p>
<p>This is my code.</p>
<pre><code>router.post(&quot;/MultiCards/:any&quot;, (req, res) =&gt; {
  let order = req.body.order ? req.body.order : &quot;desc&quot;;
  let sortBy = req.body.sortBy ? req.body.sortBy : &quot;_id&quot;;
  let limit = req.body.limit ? parseInt(req.body.limit) : 100;

  Product.find({ _id: req.params.any })
    .sort([[sortBy, order]])
    .limit(limit)
    .exec((err, products) =&gt; {
      if (err) return res.status(400).json({ success: false, err });
      res
        .status(200)
        .json({ success: true, products, postSize: products.length });
    });
});
</code></pre>

