How to query two Collections and return one response?<p>I am trying to get the result of movies + the average rating for each movie.
The information lays in two different collections. The rating collection holds the movie ID. </p>

<p>Movies - the main collection</p>

<pre><code>[
    {
        name: "The Matrix"
        genres: [
            "5e80bc463c410a7291dee8c1",
            "5e80bc463c410a7291dee8c2"
        ],
    },
    {
        name: "The Matrix 2"
        genres: [
            "5e80bc463c410a7291dee8c1",
            "5e80bc463c410a7291dee8c2"
        ],
    }
]
</code></pre>

<p>Ratings</p>

<pre><code>[
    {
        movie: "5e3355c206c7cd030e48b8bc",
        user: "5e3355c206c7cd030e48b8b4",
        rating: 10
    },
    {
        movie: "5e3355c206c7cd030e48b34c",
        user: "5e3355c206c7cd030e48b544",
        rating: 7
    },
    {
        movie: "5e3355c206c7cd030e4823bc",
        user: "5e3355c206c7cd03344823bc",
        rating: 5
    }
}
</code></pre>

<p>I want the following result:</p>

<pre><code>{
    "total": 1,
    "page": 0,
    "perPage": 25,
    "pageSize": 1,
    "movies": [
        {
            _id: "5e3b0e57870c15002e29a238",
            name: 'The Matrix',
            genres: ['Action', 'Sci-Fi'],
            rating: 10
        },
        {
            _id: "5e3b0e57870c15002e29a239",
            name: 'The Matrix 2',
            genres: ['Action', 'Sci-Fi'],
            rating: 10
        },
    ]
}
</code></pre>

<p>I don't understand how to add the average rating for each movie into the query result.
My current query looks like this:</p>

<pre><code>Movie.find(demand)
    .select("name genres")
    .skip(page * limit)
    .limit(limit)
    .populate('genres', ['name'])
    .lean()
    .exec((err, movies) =&gt; {
        if (err) {
            return res.json(err);
        }

        Movie.countDocuments(demand).exec((count_error, count) =&gt; {
            if (err) {
                return res.json(count_error);
            }
            return res.status(200).json({
                total: count,
                page: page,
                perPage: limit,
                pageSize: movies.length,
                movies: movies
            });
        });
    });
</code></pre>

